import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Landing from './components/Landing.jsx'
import Home from './components/Home';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route  path='/' component={<Landing />}></Route>
        {/* <Route path='/home' element={Home} /> */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
